            i += 1;
            let mut out_bytes = vec![0];
            cmos.read(0, offset, &mut out_bytes);
        } else {
            let offset = (bytes.get(i).unwrap_or(&0) % 2) as u64;
            i += 1;
            let data = vec![*bytes.get(i).unwrap_or(&0)];
            i += 1;
            cmos.write(0, offset, &data);
        }
    }
